This glam look was created by using just 3 eyeshadows,
Eyeshadow 1: Light Brown
Eyeshadow 2: Dark Brown
Eyeshadow 3: Golden

Points to remember:
1) Wait for 10 secs before applying the lashes, so that the glue dries up & becomes sticky
2) Blending with fingers is a choice, I personally love doing it because it does not takes away the product, gives maximum coverage
3) Applying half lashes for a day function is just appropriate, it gives a glam but subtle look
4)Filling eyebrows with eye brow pencil is much more long lasting than doing it with any powder product, in summers, eyebrows done with pencil won’t rub off in sweat
SAVE THIS FOR LATER 👋🏻 

