Healtless waves with smokey eyes, makes a perfect combination 🔥
All the products used in this video are under ₹600, some are around ₹100 as well.
Some random tips:
1) I personally use my finger tips for blending, as it gives more coverage.
2) Cutting lashes into half, and putting the only on the ends gives a more natural look
3) Using a darker shade of concealer cancel outs the darkness & hides the dark circles.

